import React from "react"


class AppTitle extends React.Component {


    constructor(props) {
        super()
        this.state = {
            players: [],
        }
    }

    componentDidMount() {
        fetch('/api/players')
            .then(res => res.json())
            .then(players => this.setState({players: players.playerStatsTotals}))


    }

    render() {
        const names = this.state.players.map((player, index) => {
            return(
                <p>{player.firstName} {player.lastName}</p>
            )
        })
        return (
            <div>
                <h1>{this.props.title}</h1>
                {names}


            </div>

            )
    }



}

  export default AppTitle
